textOriginal:
esses marginais dos institutos de pesquisas;

devam ser candidatos ao presídio especial no centro de uma floresta; sem retorna a sociedade;

seus condescendentes; igualmente presos; porque coniventes; quem for: brasileiro nato; integrará o novo Brasil.

o Brasil, tem soberania;

um por todos; todos por um;

jamais; abriremos mão;

as últimas consequências;

ímpar, pátria amada: a tônica.

Novo Brasil, coração do mundo; celeiro para humanidade; pátria de amor poor excelência;

Deus, muito feliz.

boa noite; senhores; seus familiares; colaboradores;

você está falando da bichinha louca; saltitante;

ele deve entender bem é de outras, coisas;

pederasta, estonteante.

Novo Brasil, coração do mundo; pátria de amor, por excelência; celeiro, célere para humanidade.

Deus, feliz.

bom dia senhores; familiares; colaboradores;

parabéns;

Grande ministro; general Heleno;

sabedoria e humildade;

Grande, Augusto Nunes.

excelente entrevista;

olhem uma coisa: toda essa marginalidade; de fato e de direito; 
preguiçosos; 
incompetentes; 
"adoradores, de molezas; por suas pretensões, covardes; 
inconfidentes; 
imorais; porquê, um bandido; dono de exauridas sentenças, corroboradas; foi disponibilizado; pleitear ser de novo presidente da república; a fim de perpetuar, todo tipo crimes, juntamente com seus comparsas; a própria pátria;

que pulgas! fúteis que são; desejam o desagregamento, ao conceito família; vindo de Deus.

estão em apuros;

seus fim: "terminar; na praia; 

macabros, audaciosos;  sem limites;

 praticam, todo tipo de mentiras;  contra propagadores do bem, comum;

Novo Brasil, coração do mundo; celeiro para humanidade; pátria de amor por excelência;

Deus, extremamente; satisfeito.
